import React, { createContext, useEffect, useState, useContext } from 'react';
import { geAtutocomplete } from './actions'
import { connect } from 'react-redux';

function AutomaticCities(props) {
    // useEffect(()=>{
        
    // }, []);
    
    return (
        <div>
            <li>gfhfgrfh</li>
            {props.geAtutocomplete('Tel')}
            {console.log("hghg")}
            {console.log(props)}
            {props.allCitiesCompleat.map(c =>{
                <li key={c.Key}>{c.Key}</li>
            })}
        </div>
    )
}
const myMapStateToProps = (state) =>{
    console.log(state)
    return{
        allCitiesCompleat: state.automatic
    }
}
export default connect(myMapStateToProps, {geAtutocomplete})(AutomaticCities);
